import React from "react";
import useInterval from "../hooks/useInterval";

const CountDown = () => {
  const [count, setCount] = useState(0);

  useInterval(() => {
    setCount(count + 1);
  }, 1000);
  return <h1>{count}</h1>;
};

export default CountDown;
